import React from 'react' ;
import '../styles/home.css'
import { Container , Row ,Col} from 'reactstrap';
import heroImg from '../assets/images/hero-img01.jpg';
import heroImg02 from '../assets/images/hero-img02.jpg';
import heroVideo from '../assets/images/hero-video.mp4';
import Subtitle from '../shared/Subtitle';
import WorldImg from '../assets/images/world.png'



const Home = () => {
    return <>
    {/* ==========hero section start===============*/}
        <section>
            <Container>
                <Row>
                    <Col lg='6'>
                        <div className="hero__content">
                            <div className="hero__subtitle d-flex align-items-center">
                                <Subtitle subtitle={'Know Before You Go'}/>
                                    <img src={WorldImg} alt=""/>                               
                            </div>
                            <h1>Traveling opens the door to creating
                            <span className="highlight"> memories</span></h1>
                            <p>Lorem ipsum dolor sit amet consectetur adipisicing elit. Similique corporis dolores 
                               aperiam iusto. Eaque, eius. Nostrum, blanditiis. Repudiandae et possimus laborum, 
                               enim debitis, ea consectetur aliquam dolorem ex quasi neque.</p>
                        </div>
                    </Col>

                    <col lg='2'>
                        <div className="hero__img-box">
                            <img src={heroImg} alt=""/>
                        </div>
                    </col>
                </Row>
            </Container>
        </section>
    {/* ==========hero section end===============*/}
    
    </>
};

export default Home;
